--
-- Name: z_log_db_func(text[]); Type: FUNCTION; Schema: db_log; Owner: postgres
--

CREATE FUNCTION db_log.z_log_db_func(in_text_array text[], OUT out_text text) RETURNS text
    LANGUAGE plpgsql
    AS $$
-- ключ в первом элементе массива =  'успешно' или'ошибка' (работа функции)
-- во втором элементе или продолжительность работы кода (если успешно) или JSON массив с ошибками
-- [3] - запрос в нем должно быть имя функции

/*
 Данный код срабатывает при наличии ошибки
 во время выполнения функции  и фиксирует описание ошибки в БД в таблице 
 -- Отдельная функция, если вдруг что то поменять по ключам или вообще удалить.
 */
-- select db_log.z_log_db_func(array['1', '2']);


declare
p_func_name text;

begin

	--raise notice '%', in_text_array;
	-- ключ в первом элементе массива =  'успешно' или'ошибка' (работа функции)
	if in_text_array[1]='успешно'
	then
		p_func_name:=in_text_array[3];
		p_func_name:=(select regexp_replace(lower(p_func_name), 'select|perform', '', 'g') );
		--p_func_name:=(select (substring(p_func_name from '(\w{1,100}\.\w{1,100})' ) )); --удаляет ключи, передаваемые в функцию
		
		out_text:='Запись об успехе добавлена в логи по обработке функций';
	elsif in_text_array[1]='ошибка'
	then
	
		out_text:='Ошибка внесена в логи по обработке функций';
	else	-- все прочее - неверно переданный ключ в первом элементе массива
	
		out_text:='Ошибка внесена в логи по обработке функций';
	end if;


RETURN;

	

EXCEPTION WHEN OTHERS then
	-- защита от подвисания программы
	out_text:='в функции log_db_func() произошла ошибка';

	raise notice '%', out_text;
	RETURN ;


end; 



$$;


